        </Link>
        <Link href="/about">
          <a className="navlink">About</a>
        </Link>
      </div>
    </div>
    <style jsx>
      {`
        .navbar {
          display: block;
        }

        .navlink:hover {
          opacity: 0.6;
        }
      `}
    </style>
  </>
);

export default Header;
